<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <link rel="stylesheet" href="style/general.css">
  <link rel="stylesheet" href="style/header.css">
  <link rel="stylesheet" href="style/container-timer.css">
  <link rel="stylesheet" href="style/control-timer.css">
  <link rel="stylesheet" href="style/notifications-timer.css">
  <link rel="stylesheet" href="style/menu-lable.css">
  <title>Timer</title>
</head>
<body>
<section>
  <header>
    <p class="time"></p>
    <div class="icons-panel">
      <div class="cellular-signal-icon-container">
        <img src="assets/images/icon/cellular-signal-icon.png" alt="">
      </div>
      <div class="wifi-icon-container">        
        <img src="assets/images/icon/wifi-icon.png" alt="">
      </div>
      <div class="battery-status-icon-container">       
        <img src="assets/images/icon/battery-status-icon.png" alt="">
      </div>
    </div>
  </header>

  <div class="container-timer">
    <div class="input-timer">
      <input class="hours-input" min="0" max="23" type="number">
      <p>hours</p>
      <input class="min-input" min="0" max="59" type="number">
      <p>min</p>
      <input class="sec-input" min="0" max="59" type="number">
      <p>sec</p>
    </div>
    <svg class="container-countdown" viewBox="0 0 100 100">
      <circle cx="50" cy="50" r="45" class="base" />
      <circle
        cx="50"
        cy="50"
        r="45"
        class="progress"
        transform="rotate(-90 50 50)"
      />
    </svg>  
    <p class="score-timer"></p>
    <div class="alarm-timer"></div>
  </div>

  
  <div class="control-timer">
    <div class="button-cancel-container">
      <button class="button-cancel">Cancel</button>
    </div>
    <div class="button-start-container">
      <button class="button-start">Start</button>
    </div>
  </div>

  <div class="notifications-timer">
    <p class="lable">When Timer Ends</p>
    <p class="name-signal">Stargaze &gt;</p>
  </div>
  
  <div class="menu-lable">
    <div class="world-clock-icon-container">
      <img src="assets/images/icon/alarm-status-icon.png" alt="">
      <p>World Clock</p>
    </div>
    <div class="alarm-icon-container">
      <img src="assets/images/icon/alarm-status-icon.png" alt="">
      <p>Alarm</p>
    </div>
    <div class="stopwatch-clock-icon-container">
      <img src="assets/images/icon/alarm-status-icon.png" alt="">
      <p>Stopwatch</p>
    </div>
    <div class="timer-icon-container">
      <img src="assets/images/icon/alarm-status-icon.png" alt="">
      <p>Timer</p>
    </div>
  </div>
  <div class="liner"></div>
</section>
